  <React.StrictMode>
    <div>
      <App />
      <App name = "Jack Bauer" img = "https://pbs.twimg.com/profile_images/625247595825246208/X3XLea04_400x400.jpg" tel="+987 654 321" email="jack@nowhere.com" />
      <App />
    </div>
  </React.StrictMode>
);

